  useEffect(() => {
    getCards();
  });
  return(
    <div className="App">Heena</div>
  )
}

const mapStateToProps = (state) => {
  return {
    apierror: state.user.apierror,
  }
}
export default connect(mapStateToProps, { getCards })(App);

